import styled from 'styled-components';

export const Button = styled.button`
  display: inline-flex;
  padding: 14px 89px;
  justify-content: center;
  align-items: center;
  border-radius: 8px;
  background: ${props => (props.approve === 'true' ? '#BEDBB0' : '#121212')};
`;
export const Icon = styled.icon`
  stroke: ${props => (props.approve === 'true' ? '#121212' : '#fff')};
`;
